import React from 'react'
import {FaShoppingCart} from "react-icons/fa";
import { Link } from 'react-router-dom';

export const NavBar = () => {
  return (
    <nav className='flex flex-row justify-between'>
        <Link to='/'>
            <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.vecteezy.com%2Ffree-vector%2Fshopping-logo&psig=AOvVaw0CxEgaQgLnllWweeDCQTIL&ust=1691397194473000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCJjp9t3Px4ADFQAAAAAdAAAAABAL' alt="logo"/>
        </Link>
        <div>
            <Link to="/">
               <p>Home</p>
            </Link>
            <Link to='/CartPage'>
                <FaShoppingCart/>
            </Link>
        </div>
    </nav>
  )
}
